## Create a TooltipProvider

Next, we create a TooltipProvider that will be used to wrap the Tooltip component. The TooltipProvider will have a state that will be used to store the currently opened Tooltip. The TooltipProvider will also have a function that will be used to close the currently opened Tooltip.
```
import React from 'react';
import TooltipContext from './TooltipContext';

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = React.useState(null);

  const closeTooltip = () => {
    setTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ tooltip, closeTooltip }}>
      {children}
